import Friend from "./Friend/Friend";

const Friends = () => {
    return (
        <div className={s.items}>
            <Friend name={friendData[1].name} />
            <Friend name={'Nurik'} id={'2'}/>
            <Friend name={'Madya'} id={'3'}/>
            <Friend name={'Damik'} id={'4'}/>
            <Friend name={'Sam'} id={'5'}/>
        </div>
    );
};

export default Friends;
